import React, { useState, useEffect, useRef } from 'react';
import { Link, useLocation, useNavigate } from 'react-router-dom';
import './Navbar.css';

function Navbar() {
  const [showNavbar, setShowNavbar] = useState(true);
  const [prevScrollPos, setPrevScrollPos] = useState(window.scrollY);
  const [menuOpen, setMenuOpen] = useState(false);
  const location = useLocation();
  const navigate = useNavigate();
  const navRef = useRef();
  const [coursesOpen, setCoursesOpen] = useState(false);

  useEffect(() => {
    const handleScroll = () => {
      const currentScrollPos = window.scrollY;
      setShowNavbar(prevScrollPos > currentScrollPos || currentScrollPos < 10);
      setPrevScrollPos(currentScrollPos);
    };
    window.addEventListener('scroll', handleScroll, { passive: true });
    return () => window.removeEventListener('scroll', handleScroll);
  }, [prevScrollPos]);

  useEffect(() => {
    const handleClickOutside = (event) => {
      if (navRef.current && !navRef.current.contains(event.target)) {
        setMenuOpen(false);
      }
    };
    document.addEventListener('mousedown', handleClickOutside);
    return () => document.removeEventListener('mousedown', handleClickOutside);
  }, []);

  const isActive = (path) => location.pathname === path;

  const handleLinkClick = (path) => {
    navigate(path);
    window.scrollTo({ top: 0, behavior: 'smooth' });
    setMenuOpen(false);
  };

  return (
    <nav
      className={`navbar ${showNavbar ? 'visible' : 'hidden'}`}
      ref={navRef}
      aria-label="Primary"
    >
      <div className="navbar-backdrop" />
      <div className="navbar-container">
        <div className="logo-container">
          <Link to="/" onClick={(e) => { e.preventDefault(); handleLinkClick('/'); }} className="logo-link">
            <img src="/Images/logo.svg" alt="Logo" className="logo" />
          </Link>
        </div>

        <div className={`nav-links ${menuOpen ? 'open' : ''}`} role="menubar" aria-hidden={!menuOpen}>
          <Link to="/" role="menuitem" className={`nav-link ${isActive('/') ? 'active' : ''}`} onClick={(e) => { e.preventDefault(); handleLinkClick('/'); }}>
            <span>Home</span>
          </Link>
          <Link to="/about" role="menuitem" className={`nav-link ${isActive('/about') ? 'active' : ''}`} onClick={(e) => { e.preventDefault(); handleLinkClick('/about'); }}>
            <span>About</span>
          </Link>
          <Link to="/donation" role="menuitem" className={`nav-link ${isActive('/donation') ? 'active' : ''}`} onClick={(e) => { e.preventDefault(); handleLinkClick('/donation'); }}>
            <span>Donation</span>
          </Link>
          <Link to="/event" role="menuitem" className={`nav-link ${isActive('/event') ? 'active' : ''}`} onClick={(e) => { e.preventDefault(); handleLinkClick('/event'); }}>
            <span>Event</span>
          </Link>
          <Link to="/blog" role="menuitem" className={`nav-link ${isActive('/blog') ? 'active' : ''}`} onClick={(e) => { e.preventDefault(); handleLinkClick('/blog'); }}>
            <span>Blog</span>
          </Link>
          <Link to="/contact" role="menuitem" className={`nav-link ${isActive('/contact') ? 'active' : ''}`} onClick={(e) => { e.preventDefault(); handleLinkClick('/contact'); }}>
            <span>Contact</span>
          </Link>
        </div>

        <div className="right-section">
          <div className="right-inner">
            <button
              className="join-button"
              onClick={() => handleLinkClick('/contact')}
            >
              <span className="join-glow" />
              Join With Us
            </button>
            <button
              className={`menu-icon ${menuOpen ? 'active' : ''}`}
              onClick={() => setMenuOpen(!menuOpen)}
              aria-label="Toggle menu"
              aria-expanded={menuOpen}
              aria-controls="primary-navigation"
            >
              <div className="hamburger">
                <span />
                <span />
                <span />
              </div>
            </button>
          </div>
        </div>
      </div>
    </nav>
  );
}

export default Navbar;
